{
	if (m_needUpdate == 0) return;
	m_needUpdate = 0;
	switch (m_val) {
		case 0: {NORMALNYZAZNACZONY_draw(m_x,m_y); ODBITYODZNACZONY_draw((m_x+73), m_y);} break;
		default: {NORMALNYODZNACZONY_draw((m_x+73),m_y); ODBITYZAZNACZONY_draw(m_x, m_y);} break;
	}
}
